contracts/lib/TreasurerUtils.sol.content:
// SPDX-License-Identifier: MIT

pragma solidity ^0.8.0;

library TreasurerUtils {
  // Converts a week number into a timestamp.
  function weekToTimestamp(uint256 week) internal pure returns (uint256) {
    return week * 7 days + 4 days;
  }

  // Converts a UNIX timestamp to its week number since 1970-01-01
  // Will not work for timestamps below 4 days, but it does not matter,
  // since no time machine has been created so far.
  function timestampToWeek(uint256 timestamp) internal pure returns (uint256) {
    return (timestamp - 4 days) / 7 days;
  }
}

contracts/ZkHarvest.sol.content:
// SPDX-License-Identifier: UNLICENSED

pragma solidity ^0.8.0;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/token/ERC20/utils/SafeERC20.sol";
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";

import "./interface/ITreasurer.sol";
import "./ZkHarvestToken.sol";

contract ZkHarvest is Ownable, ReentrancyGuard {
  using SafeERC20 for IERC20;

  modifier onlyDev() {
    require(msg.sender == dev, "ZkHarvest Dev: caller is not the dev");
    _;
  }

  modifier onlyFeeCollector() {
    require(
      msg.sender == feeCollector,
      "ZkHarvest Fee Collector: caller is not the fee collector"
    );
    _;
  }

  // Category informations
  struct CatInfo {
    // Allocation points assigned to this category
    uint256 allocPoints;
    // Total pool allocation points. Must be at all time equal to the sum of all
    // pool allocation points in this category.
    uint256 totalPoolAllocPoints;
    // Name of this category
    string name;
  }

  // User informations
  struct UserInfo {
    // Amount of tokens deposited
    uint256 amount;
    // Reward debt.
    //
    // We do some fancy math here. Basically, any point in time, the amount of ZKHs
    // entitled to a user but is pending to be distributed is:
    //
    //   pending reward = (user.amount * pool.accZKHPerShare) - user.rewardDebt + user.locked
    //
    // Whenever a user deposits or withdraws LP tokens to a pool. Here's what happens:
    //   1. The pool's `accZKHPerShare` (and `lastRewardTime`) gets updated.
    //   2. User receives the available reward sent to his/her address.
    //   3. User's `amount` gets updated.
    //   4. User's `rewardDebt` gets updated.
    uint256 rewardDebt;
    // Time at which user can harvest this pool again
    uint256 nextHarvestTime;
    // Reward that will be unlockable when nextHarvestTime is reached
    uint256 lockedReward;
  }

  // Pool informations
  struct PoolInfo {
    // Address of this pool's token
    IERC20 token;
    // Category ID of this pool
    uint256 catId;
    // Allocation points assigned to this pool
    uint256 allocPoints;
    // Last time where ZKH was distributed.
    uint256 lastRewardTime;
    // Accumulated ZKH per share, times 1e18. Used for rewardDebt calculations.
    uint256 accZKHPerShare;
    // Deposit fee for this pool, in basis points (from 0 to 10000)
    uint256 depositFeeBP;
    // Harvest interval for this pool, in seconds
    uint256 harvestInterval;
  }

  // The following limits exist to ensure that the owner of ZkHarvest will
  // only modify the contract's settings in a specific range of value, that
  // the users can see by themselves at any time.

  // Maximum harvest interval that can be set
  uint256 public constant MAX_HARVEST_INTERVAL = 24 hours;
  // Maximum deposit fee that can be set
  uint256 public constant MAX_DEPOSIT_FEE_BP = 400;
  // Maximum ZKH reward per second that can be set
  uint256 public constant MAX_ZKH_PER_SECOND = 4629629629629629630; // ~400k/d

  // The informations of each category
  CatInfo[] public catInfo;
  // The pools in each category. Used in front.
  mapping(uint256 => uint256[]) public catPools;
  // Total category allocation points. Must be at all time equal to the sum of
  // all category allocation points.
  uint256 public totalCatAllocPoints = 0;

  // The informations of each pool
  PoolInfo[] public poolInfo;
  // Mapping to keep track of which token has been added, and its index in the
  // array.
  mapping(address => uint256) public tokensAdded;
  // The informations of each user, per pool
  mapping(uint256 => mapping(address => UserInfo)) public userInfo;

  // The ZKH token
  ZkHarvestToken public immutable zkh;
  // The Treasurer. Handles rewards.
  ITreasurer public immutable treasurer;
  // ZKH minted to devs per second
  uint256 public devZKHPerSecond;
  // ZKH minted as rewards per second
  uint256 public rewardZKHPerSecond;
  // The address to send dev funds to
  address public dev;
  // The address to send fees to
  address public feeCollector;
  // Launch time
  uint256 public startTime;
  // Farming duration, in seconds
  uint256 public farmingDuration;

  event CategoryCreate(uint256 id, string indexed name, uint256 allocPoints);
  event CategoryEdit(uint256 id, uint256 allocPoints);

  event PoolCreate(
    address indexed token,
    uint256 indexed catId,
    uint256 allocPoints,
    uint256 depositFeeBP,
    uint256 harvestInterval
  );
  event PoolEdit(
    address indexed token,
    uint256 indexed catId,
    uint256 allocPoints,
    uint256 depositFeeBP,
    uint256 harvestInterval
  );

  event Deposit(
    address indexed user,
    uint256 indexed pid,
    uint256 amount,
    uint256 fee
  );
  event Withdraw(address indexed user, uint256 indexed pid, uint256 amount);
  event EmergencyWithdraw(
    address indexed user,
    uint256 indexed pid,
    uint256 amount
  );

  constructor(
    ZkHarvestToken _zkh,
    ITreasurer _treasurer,
    address _dev,
    address _feeCollector,
    uint256 _initZKHPerSecond,
    uint256 _startTime
  ) {
    zkh = _zkh;
    treasurer = _treasurer;
    require(
      _initZKHPerSecond <= MAX_ZKH_PER_SECOND,
      "ZkHarvest: too high ZKH reward"
    );
    devZKHPerSecond = _initZKHPerSecond / 10;
    rewardZKHPerSecond = _initZKHPerSecond - devZKHPerSecond;
    require(_dev != address(0), "ZkHarvest Dev: null address not permitted");
    dev = _dev;
    require(
      _feeCollector != address(0),
      "ZkHarvest Fee Collector: null address not permitted"
    );
    feeCollector = _feeCollector;
    startTime = _startTime;
    if (startTime < block.timestamp) {
      startTime = block.timestamp;
    }
    farmingDuration =
      (_zkh.maxSupply() - _zkh.totalMinted()) /
      _initZKHPerSecond;
  }

  // Update the starting time. Can only be called by the owner.
  // Can only be called before current starting time.
  // Can only be called if there is no pool registered.
  function updateStartTime(uint256 _newStartTime) external onlyOwner {
    require(
      block.timestamp < startTime,
      "ZkHarvest: Cannot change startTime after farming has already started."
    );
    require(
      poolInfo.length == 0,
      "ZkHarvest: Cannot change startTime after a pool has been registered."
    );
    require(
      _newStartTime > block.timestamp,
      "ZkHarvest: Cannot change startTime with a past timestamp."
    );
    startTime = _newStartTime;
  }

  // Update the dev address. Can only be called by the dev.
  function updateDev(address _newDev) public onlyDev {
    require(_newDev != address(0), "ZkHarvest Dev: null address not permitted");
    dev = _newDev;
  }

  // Update the fee address. Can only be called by the fee collector.
  function updateFeeCollector(
    address _newFeeCollector
  ) public onlyFeeCollector {
    require(
      _newFeeCollector != address(0),
      "ZkHarvest Fee Collector: null address not permitted"
    );
    feeCollector = _newFeeCollector;
  }

  // Update the ZKH per second reward. Can only be called by the owner.
  function updateZKHPerSecond(
    uint256 _newZKHPerSecond,
    bool _withUpdate
  ) public onlyOwner {
    require(
      _newZKHPerSecond <= MAX_ZKH_PER_SECOND,
      "ZkHarvest: too high ZKH reward"
    );

    if (_withUpdate) {
      massUpdatePools();
    }
    devZKHPerSecond = _newZKHPerSecond / 10;
    rewardZKHPerSecond = _newZKHPerSecond - devZKHPerSecond;
    _updateEndTime();
  }

  function elapsedTime() public view returns (uint256) {
    if (block.timestamp > startTime) {
      return block.timestamp - startTime;
    }
    return 0;
  }

  function _updateEndTime() internal {
    farmingDuration =
      elapsedTime() +
      (zkh.maxSupply() - zkh.totalMinted()) /
      ZKHPerSecond();
  }

  function updateEndTime(bool _withUpdate) external onlyOwner {
    if (_withUpdate) {
      massUpdatePools();
    }
    _updateEndTime();
  }

  // View function to check the total ZKH generated every second
  function ZKHPerSecond() public view returns (uint256) {
    return devZKHPerSecond + rewardZKHPerSecond;
  }

  // View function to check if user can harvest pool
  function canHarvest(
    uint256 _poolId,
    address _user
  ) public view returns (bool) {
    return block.timestamp >= userInfo[_poolId][_user].nextHarvestTime;
  }

  // Create a new pool category. Can only be called by the owner.
  function createCategory(
    string calldata _name,
    uint256 _allocPoints,
    bool _withUpdate
  ) public onlyOwner {
    if (_withUpdate) {
      massUpdatePools();
    }

    totalCatAllocPoints += _allocPoints;

    catInfo.push(
      CatInfo({name: _name, allocPoints: _allocPoints, totalPoolAllocPoints: 0})
    );

    emit CategoryCreate(catInfo.length - 1, _name, _allocPoints);
  }

  // Edit a pool category. Can only be called by the owner.
  function editCategory(
    uint256 _catId,
    uint256 _allocPoints,
    bool _withUpdate
  ) public onlyOwner {
    require(_catId < catInfo.length, "ZkHarvest: category does not exist");

    if (_withUpdate) {
      massUpdatePools();
    }

    totalCatAllocPoints =
      totalCatAllocPoints -
      catInfo[_catId].allocPoints +
      _allocPoints;
    catInfo[_catId].allocPoints = _allocPoints;

    emit CategoryEdit(_catId, _allocPoints);
  }

  // Create a new token pool, after checking that it doesn't already exist.
  // Can only be called by owner.
  function createPool(
    uint256 _catId,
    IERC20 _token,
    uint256 _allocPoints,
    uint256 _depositFeeBP,
    uint256 _harvestInterval,
    bool _withUpdate
  ) public onlyOwner {
    require(_catId < catInfo.length, "ZkHarvest: category does not exist");
    require(
      _harvestInterval <= MAX_HARVEST_INTERVAL,
      "ZkHarvest: too high harvest interval"
    );
    require(
      _depositFeeBP <= MAX_DEPOSIT_FEE_BP,
      "ZkHarvest: too high deposit fee"
    );

    address tokenAddress = address(_token);
    require(
      tokensAdded[tokenAddress] == 0,
      "ZkHarvest: token already registered"
    );

    if (_withUpdate) {
      massUpdatePools();
    }

    uint256 lastRewardTime = block.timestamp > startTime
      ? block.timestamp
      : startTime;

    catInfo[_catId].totalPoolAllocPoints += _allocPoints;

    tokensAdded[tokenAddress] = poolInfo.length + 1;
    poolInfo.push(
      PoolInfo({
        catId: _catId,
        token: _token,
        allocPoints: _allocPoints,
        lastRewardTime: lastRewardTime,
        accZKHPerShare: 0,
        depositFeeBP: _depositFeeBP,
        harvestInterval: _harvestInterval
      })
    );
    catPools[_catId].push(poolInfo.length - 1);

    emit PoolCreate(
      tokenAddress,
      _catId,
      _allocPoints,
      _depositFeeBP,
      _harvestInterval
    );
  }

  // Edits a new token pool. Can only be called by owner.
  function editPool(
    uint256 _poolId,
    uint256 _allocPoints,
    uint256 _depositFeeBP,
    uint256 _harvestInterval,
    bool _withUpdate
  ) public onlyOwner {
    require(_poolId < poolInfo.length, "ZkHarvest: pool does not exist");
    require(
      _harvestInterval <= MAX_HARVEST_INTERVAL,
      "ZkHarvest: too high harvest interval"
    );
    require(
      _depositFeeBP <= MAX_DEPOSIT_FEE_BP,
      "ZkHarvest: too high deposit fee"
    );

    if (_withUpdate) {
      massUpdatePools();
    }

    uint256 catId = poolInfo[_poolId].catId;

    catInfo[catId].totalPoolAllocPoints =
      catInfo[catId].totalPoolAllocPoints -
      poolInfo[_poolId].allocPoints +
      _allocPoints;
    poolInfo[_poolId].allocPoints = _allocPoints;
    poolInfo[_poolId].depositFeeBP = _depositFeeBP;
    poolInfo[_poolId].harvestInterval = _harvestInterval;

    emit PoolEdit(
      address(poolInfo[_poolId].token),
      poolInfo[_poolId].catId,
      _allocPoints,
      _depositFeeBP,
      _harvestInterval
    );
  }

  function getMultiplier(
    uint256 _from,
    uint256 _to
  ) public view returns (uint256) {
    uint256 _endTime = endTime();
    if (_from >= _endTime) {
      return 0;
    }
    if (_to > _endTime) {
      return _endTime - _from;
    }
    return _to - _from;
  }

  // Internal function to dispatch pool reward for sender.
  // Does one of two things:
  // - Reward the user through treasurer
  // - Lock up rewards for later harvest
  function _dispatchReward(uint256 _poolId) internal {
    PoolInfo storage pool = poolInfo[_poolId];
    UserInfo storage user = userInfo[_poolId][msg.sender];

    if (user.nextHarvestTime == 0) {
      user.nextHarvestTime = block.timestamp + pool.harvestInterval;
    }

    uint256 pending = (user.amount * pool.accZKHPerShare) /
      1e18 -
      user.rewardDebt;
    if (block.timestamp >= user.nextHarvestTime) {
      if (pending > 0 || user.lockedReward > 0) {
        uint256 totalReward = pending + user.lockedReward;

        user.lockedReward = 0;
        user.nextHarvestTime = block.timestamp + pool.harvestInterval;

        treasurer.rewardUser(msg.sender, totalReward);
      }
    } else if (pending > 0) {
      user.lockedReward += pending;
    }
  }

  // Deposits tokens into a pool.
  function deposit(uint256 _poolId, uint256 _amount) public nonReentrant {
    PoolInfo storage pool = poolInfo[_poolId];
    require(pool.allocPoints != 0, "ZkHarvest Deposit: pool is disabled");
    require(
      catInfo[pool.catId].allocPoints != 0,
      "ZkHarvest Deposit: category is disabled"
    );
    UserInfo storage user = userInfo[_poolId][msg.sender];

    updatePool(_poolId);
    _dispatchReward(_poolId);

    uint256 depositFee = (_amount * pool.depositFeeBP) / 1e4;
    if (_amount > 0) {
      pool.token.safeTransferFrom(msg.sender, address(this), _amount);

      if (pool.depositFeeBP > 0) {
        pool.token.safeTransfer(feeCollector, depositFee);
        user.amount += _amount - depositFee;
      } else {
        user.amount += _amount;
      }
      user.nextHarvestTime = block.timestamp + pool.harvestInterval;
    }
    user.rewardDebt = (user.amount * pool.accZKHPerShare) / 1e18;

    emit Deposit(msg.sender, _poolId, _amount, depositFee);
  }

  // Withdraw tokens from a pool.
  function withdraw(uint256 _poolId, uint256 _amount) public nonReentrant {
    PoolInfo storage pool = poolInfo[_poolId];
    UserInfo storage user = userInfo[_poolId][msg.sender];

    require(user.amount >= _amount, "ZkHarvest: bad withdrawal");
    updatePool(_poolId);
    _dispatchReward(_poolId);

    user.amount -= _amount;
    user.rewardDebt = (user.amount * pool.accZKHPerShare) / 1e18;

    if (_amount > 0) {
      pool.token.safeTransfer(msg.sender, _amount);
    }

    emit Withdraw(msg.sender, _poolId, _amount);
  }

  // EMERGENCY ONLY. Withdraw tokens, give rewards up.
  function emergencyWithdraw(uint256 _poolId) public nonReentrant {
    PoolInfo storage pool = poolInfo[_poolId];
    UserInfo storage user = userInfo[_poolId][msg.sender];

    pool.token.safeTransfer(address(msg.sender), user.amount);
    emit EmergencyWithdraw(msg.sender, _poolId, user.amount);
    user.amount = 0;
    user.rewardDebt = 0;
    user.lockedReward = 0;
    user.nextHarvestTime = 0;
  }

  // Update all pool at ones. Watch gas spendings.
  function massUpdatePools() public {
    uint256 length = poolInfo.length;
    for (uint256 poolId = 0; poolId < length; poolId++) {
      updatePool(poolId);
    }
  }

  // Update a single pool's reward variables, and mints rewards.
  // If the pool has no tokenSupply, then the reward will be fully sent to the
  // dev fund. This is done so that the amount of tokens minted every second
  // is stable, and the end of farming is predictable and only impacted by
  // updateZKHPerSecond.
  function updatePool(uint256 _poolId) public {
    PoolInfo storage pool = poolInfo[_poolId];
    if (
      block.timestamp <= pool.lastRewardTime ||
      pool.allocPoints == 0 ||
      catInfo[pool.catId].allocPoints == 0
    ) {
      return;
    }
    uint256 multiplier = getMultiplier(pool.lastRewardTime, block.timestamp);
    if (multiplier == 0) {
      pool.lastRewardTime = block.timestamp;
      return;
    }
    uint256 tokenSupply = pool.token.balanceOf(address(this));
    CatInfo storage cat = catInfo[pool.catId];
    uint256 userReward = (((multiplier *
      rewardZKHPerSecond *
      pool.allocPoints) / cat.totalPoolAllocPoints) * cat.allocPoints) /
      totalCatAllocPoints;
    uint256 devReward = (((multiplier * devZKHPerSecond * pool.allocPoints) /
      cat.totalPoolAllocPoints) * cat.allocPoints) / totalCatAllocPoints;
    pool.lastRewardTime = block.timestamp;
    if (tokenSupply == 0) {
      zkh.mint(dev, userReward);
    } else {
      pool.accZKHPerShare += (userReward * 1e18) / tokenSupply;
      zkh.mint(address(treasurer), userReward);
    }
    zkh.mint(dev, devReward);
  }

  /**
   *
   * @param _poolId the pool id to check pending rewards for
   * @param _user the user to check pending rewards for
   * @return pendingReward
   * @return currentTimestamp
   */
  function pendingReward(
    uint256 _poolId,
    address _user
  ) external view returns (uint256, uint256) {
    PoolInfo storage pool = poolInfo[_poolId];
    UserInfo storage user = userInfo[_poolId][_user];
    CatInfo storage cat = catInfo[pool.catId];
    uint256 accZKHPerShare = pool.accZKHPerShare;
    uint256 tokenSupply = pool.token.balanceOf(address(this));

    if (block.timestamp > pool.lastRewardTime && tokenSupply != 0) {
      uint256 multiplier = getMultiplier(pool.lastRewardTime, block.timestamp);
      if (multiplier != 0) {
        uint256 userReward = (((multiplier *
          rewardZKHPerSecond *
          pool.allocPoints) / cat.totalPoolAllocPoints) * cat.allocPoints) /
          totalCatAllocPoints;
        accZKHPerShare += (userReward * 1e18) / tokenSupply;
      }
    }
    return (
      (user.amount * accZKHPerShare) /
        1e18 -
        user.rewardDebt +
        user.lockedReward,
      block.timestamp
    );
  }

  function poolsLength() external view returns (uint256) {
    return poolInfo.length;
  }

  function categoriesLength() external view returns (uint256) {
    return catInfo.length;
  }

  function poolsInCategory(
    uint256 _catId
  ) external view returns (uint256[] memory) {
    return catPools[_catId];
  }

  function endTime() public view returns (uint256) {
    return startTime + farmingDuration;
  }
}

contracts/ZkHarvestIFO.sol.content:
// SPDX-License-Identifier: UNLICENSED

pragma solidity ^0.8.0;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";

import "./ZkHarvestToken.sol";

contract ZkHarvestIFO is Ownable, ReentrancyGuard {
  uint256 constant MAX_REFERRAL_REWARD_BP = 1500;

  // All the states the IFO can be in
  // CLOSED can mean two things:
  // - raisedAmount >= minAmountToRaise => Closed and claims open
  // - raisedAmount < minAmountToRaise => Closed and refunds open
  enum State {
    NOT_STARTED,
    OPEN,
    CLOSED
  }


  event StateChange(State newState);
  event Commit(address indexed account, uint256 amount, address referral);
  event Claim(address indexed account, uint256 amount);
  event RewardsClaim(address indexed account, uint256 amount);
  event Refund(address indexed account, uint256 amount);

  // Current state of this IFO
  State public state = State.NOT_STARTED;

  // The token to receive
  ZkHarvestToken public token;

  // Team address, capable of withdrawing funds
  address payable public team;

  // Maximum amount to ETH that can be raised
  uint256 public amountToRaise;
  // Minimum amount of ETH that must be raised for the IFO to succeed
  uint256 public minAmountToRaise;
  // Supply of tokens to distribute
  uint256 public supply;

  // Minimum amount a wallet can commit
  uint256 public minAmountPerWallet;
  // Maximum amount a wallet can commit
  uint256 public maxAmountPerWallet;

  // Referral reward in basis points (1 = 0.01%)
  uint256 public referralRewardBP;

  // Amount of ETH committed per wallet
  mapping(address => uint256) public committedAmountPerWallet;
  // Total amount of ETH committed
  uint256 public raisedAmount;

  // Amount of ETH claimable as rewards per wallet (only if IFO succeeds)
  mapping(address => uint256) public referralRewards;
  // Total amount of ETH claimable as rewards (only if IFO succeeds)
  uint256 public totalReferralRewards;

  // Has wallet finalized?
  mapping(address => bool) public hasFinalized;
  // Has wallet claimed its rewards?
  mapping(address => bool) public hasClaimedReferralRewards;

  // Has team withdrawn?
  bool hasTeamWithdrawn;

  modifier onlyState(State _state) {
    require(state == _state, "wrong state for this action");
    _;
  }

  modifier onlyTeam() {
    require(_msgSender() == team, "caller is not team");
    _;
  }

  constructor(ZkHarvestToken _token, address payable _team) {
    token = _token;
    team = _team;
  }

  /**
   * Sets the team address, can only be called ny current team address
   * @param _team new team address
   */
  function setTeam(address payable _team) external onlyTeam {
    team = _team;
  }

  /**
   * Configures the IFO. Can only be done while IFO is not started.
   * @param _supply token supply to distribute
   * @param _amountToRaise max amount of ETH to raise
   * @param _minAmountToRaise min amount of ETH to consider IFO successful
   * @param _minAmountPerWallet min amount of ETH a wallet can commit
   * @param _maxAmountPerWallet max amount of ETH a wallet can commit
   * @param _referralRewardBP referral rewards in basis points
   */
  function configure(
    uint256 _supply,
    uint256 _amountToRaise,
    uint256 _minAmountToRaise,
    uint256 _minAmountPerWallet,
    uint256 _maxAmountPerWallet,
    uint256 _referralRewardBP
  ) external onlyOwner onlyState(State.NOT_STARTED) {
    require(_supply != 0, "wrong configuration: supply");
    require(_amountToRaise != 0, "wrong configuration: amountToRaise");
    require(
      _amountToRaise >= _minAmountToRaise,
      "wrong configuration: minAmountToRaise"
    );
    require(
      token.balanceOf(address(this)) >= _supply,
      "wrong configuration: supply above balance"
    );
    require(
      _minAmountPerWallet != 0,
      "wrong configuration: minAmountPerWallet"
    );
    require(
      _maxAmountPerWallet >= _minAmountPerWallet,
      "wrong configuration: min amount above max amount"
    );
    require(
      _referralRewardBP <= MAX_REFERRAL_REWARD_BP,
      "wrong configuration: referral reward above max"
    );
    supply = _supply;
    amountToRaise = _amountToRaise;
    minAmountToRaise = _minAmountToRaise;

    minAmountPerWallet = _minAmountPerWallet;
    maxAmountPerWallet = _maxAmountPerWallet;

    referralRewardBP = _referralRewardBP;
  }

  /**
   * Opens the IFO. Only when IFO is in NOT_STARTED state. Only owner.
   */
  function open() external onlyOwner onlyState(State.NOT_STARTED) {
    require(amountToRaise != 0, "not configured");
    state = State.OPEN;
    emit StateChange(State.OPEN);
  }

  /**
   * Closes the IFO. Only when IFO is in OPEN state. Only owner.
   */
  function close() external onlyOwner onlyState(State.OPEN) {
    state = State.CLOSED;
    emit StateChange(State.CLOSED);
  }

  /**
   * Commits msg.value ETH to the IFO, with optional referral address.
   * @param _referral referral address. 0x0 means no referral.
   */
  function _commit(address _referral) internal {
    require(
      msg.value + raisedAmount <= amountToRaise,
      "would go over max amount to raise"
    );
    uint256 committedAmount = committedAmountPerWallet[_msgSender()] +
      msg.value;
    require(committedAmount >= minAmountPerWallet, "msg.value too small");
    require(committedAmount <= maxAmountPerWallet, "msg.value too big");

    committedAmountPerWallet[_msgSender()] = committedAmount;
    raisedAmount += msg.value;

    if (_referral != address(0) && referralRewardBP > 0) {
      uint256 reward = (referralRewardBP * msg.value) / 10000;
      referralRewards[_referral] += reward;
      totalReferralRewards += reward;
    }

    emit Commit(_msgSender(), msg.value, _referral);
  }

  /**
   * Commits msg.value ETH without referral. Only when state is OPEN.
   */
  function commit() external payable onlyState(State.OPEN) nonReentrant {
    _commit(address(0));
  }

  /**
   * Commits msg.value ETH with optional referral. Only when state is OPEN.
   * @param _referral referral addres. 0x0 means no referral.
   */
  function commitWithReferral(
    address _referral
  ) external payable onlyState(State.OPEN) nonReentrant {
    if (_referral == _msgSender()) {
      _commit(address(0));
    } else {
      _commit(_referral);
    }
  }

  /**
   * Returns balance of claimable tokens for `_account`. Should only be used
   * in CLOSED state, in case of a successful IFO.
   * @param _account account to check the balance of
   */
  function _claimableTokens(address _account) internal view returns (uint256) {
    if (hasFinalized[_account]) {
      return 0;
    }
    return (committedAmountPerWallet[_account] * supply) / amountToRaise;
  }

  /**
   * Returns balance of claimable tokens for `account`.
   * @param _account account to check the balance of
   */
  function claimableTokens(address _account) external view returns (uint256) {
    if (state != State.CLOSED || raisedAmount < minAmountToRaise) {
      return 0;
    }
    return _claimableTokens(_account);
  }

  /**
   * Claims the claimabale tokens for msg.sender. Only when state is CLOSED,
   * and when IFO is succesful.
   */
  function claim() external onlyState(State.CLOSED) nonReentrant {
    require(
      raisedAmount >= minAmountToRaise,
      "raise goal not reached; use 'refund' to get your deposit back"
    );

    uint256 amountToClaim = _claimableTokens(_msgSender());
    require(amountToClaim > 0, "no tokens to claim");

    token.transfer(_msgSender(), amountToClaim);
    hasFinalized[_msgSender()] = true;
    emit Claim(_msgSender(), amountToClaim);
  }

  /**
   * Returns balance of refundable ETH for `_account`. Should only be used
   * in CLOSED state, in case of failed IFO.
   * @param _account account to check the refundable balance of.
   */
  function _refundableAmount(address _account) internal view returns (uint256) {
    if (hasFinalized[_account]) {
      return 0;
    }
    return committedAmountPerWallet[_account];
  }

  /**
   * Returns balance of refundable ETH for `_account`.
   * @param _account account to check the refundable balance of.
   */
  function refundableAmount(address _account) external view returns (uint256) {
    if (state != State.CLOSED || raisedAmount >= minAmountToRaise) {
      return 0;
    }
    return _refundableAmount(_account);
  }

  /**
   * Refunds committed ETH for msg.sender. Only when state is CLOSED, and IFO
   * is failed.
   */
  function refund() external onlyState(State.CLOSED) nonReentrant {
    require(
      raisedAmount < minAmountToRaise,
      "raise goal reached; use 'claim' to get your tokens"
    );

    uint256 amountToRefund = _refundableAmount(_msgSender());
    require(amountToRefund > 0, "nothing to refund");

    (bool success, ) = payable(_msgSender()).call{value: amountToRefund}("");
    require(success, "failed to refund");
    hasFinalized[_msgSender()] = true;
    emit Refund(_msgSender(), amountToRefund);
  }

    /**
   * Returns balance of claimable rewards for `_account`. Should only be used
   * in CLOSED state, in case of a successful IFO.
   * @param _account account to check the balance of
   */
  function _claimableRewards(address _account) internal view returns (uint256) {
    if (hasClaimedReferralRewards[_account]) {
      return 0;
    }
    return referralRewards[_account];
  }

  /**
   * Returns balance of claimable rewards for `account`.
   * @param _account account to check the balance of
   */
  function claimableRewards(address _account) external view returns (uint256) {
    if (state != State.CLOSED || raisedAmount < minAmountToRaise) {
      return 0;
    }
    return _claimableRewards(_account);
  }

  /**
   * Claims the claimabale rewards for msg.sender. Only when state is CLOSED,
   * and when IFO is succesful.
   */
  function claimRewards() external onlyState(State.CLOSED) nonReentrant {
    require(
      raisedAmount >= minAmountToRaise,
      "raise goal not reached; no rewards to claim"
    );

    uint256 amountToReward = _claimableRewards(_msgSender());
    require(amountToReward > 0, "nothing to claim");

    (bool success, ) = payable(_msgSender()).call{value: amountToReward}("");
    require(success, "failed to reward");
    hasClaimedReferralRewards[_msgSender()] = true;
    emit RewardsClaim(_msgSender(), amountToReward);
  }

  /**
   * Withdraws committed ETH (minus referral rewards). Only team.
   */
  function withdraw() external onlyState(State.CLOSED) onlyTeam {
    require(
      raisedAmount >= minAmountToRaise,
      "raise goal not reached; team cannot withdraw"
    );
    require(!hasTeamWithdrawn, "team already withdrew");

    uint256 amountToWithdraw = raisedAmount - totalReferralRewards;
    (bool success, ) = team.call{value: amountToWithdraw}("");
    require(success, "failed to withdraw");

    hasTeamWithdrawn = true;
  }

  /**
   * Returns the amount of unsold tokens. Should only be called when state is
   * CLOSED.
   */
  function _unsoldTokens() internal view returns (uint256) {
    if (
      raisedAmount >= minAmountToRaise
    ) {
      return token.balanceOf(address(this)) - (raisedAmount * supply / amountToRaise);
    }
    return token.balanceOf(address(this));
  }

  /**
   * Burns all unsold tokens. That means all supply in case IFO is failed.
   * Only team.
   */
  function burnUnsoldTokens() external onlyState(State.CLOSED) onlyTeam {
    uint256 unsoldTokens = _unsoldTokens();
    require(unsoldTokens > 0, "no tokens unsold");

    token.burn(unsoldTokens);
  }
}

